import React, {Component} from 'react';
import { Redirect } from 'react-router-dom';

export default class Logout extends Component {
  	constructor(props) {
	    super(props);
	    this.state = {
	    	redirect:true,
	    	hasSession:false,
	    	notif_msg:''
		}
	};
	componentDidMount(){
		fetch('/logout').then((res) => {
	      return res.json();
	    }).then((res) => {
	      // console.log(res);
	      if(res.state)
		      this.setState({hasSession: res.state, });
	    })
	    .catch((err) => {
	      // console.log(err);
	      this.setState({redirect: true, notif_msg: SERVER_ERR_MSG});
	    });
	}

	renderRedirect = () => {
		if(this.state.hasSession)
			return <Redirect to={{pathname:'/notification', msg: this.state.notif_msg, state: 0}} />
		else
			return <Redirect to={{pathname:'/', msg: this.state.notif_msg, state: 0}} />
	}

	render(){
		return(
			<div>
				{this.redirec}
			</div>
		)
	}
}
